import React, {Component} from 'react';
import './App.css';
import Todos from './components/Todos';

class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out trash.',
        completed: false
      },
      {
        id: 2,
        title: 'Do homework.',
        completed: true
      },
      {
        id: 3,
        title: 'Learn React.',
        completed: false
      },
      {
        id: 4,
        title: 'Take Notes.',
        completed: false
      },
    ]
  }

  render(){
    return (
      <div>
        This is App Component.
          <Todos todos={ this.state.todos }/>
      </div>
    );
  };
}

export default App;
